function card(props){
    return(
        <div className="card">
            <h5>{props.title}</h5>
            <h6>$ {props.price} /month</h6>
            <hr></hr>
            <ul>
                {
                    props.checked.map((val) => {
                        return <li>{val}</li>
                    })
                }

              

                {props.crossed ? (
                    props.crossed.map((val) => {
                        return <li>{val}</li>
                    })
                ) : ( null )
                }

               
             
            </ul>
        </div>
    )
}

export default card;
